import React from 'react'
import { quizAnswers } from '../data';

const QuizOptions = (props) => {
    const answers = quizAnswers[props.answersNumber];
  return (
    <div>
      {answers.map((answer) => {
        return <button key={answer}>{answer}</button>
      })}
    </div>
  )
}

export default QuizOptions
